import React from 'react';
import Nav from './Nav';
import Rahima from './components/Rahima';
import Sandra from './components/Sandra';
import Wietske from './components/Wietske';
import Storm from './components/Storm';
import 'react-router-dom';
import './App.css';

function App() {
  return (
    <div>
     <Nav />
     <Rahima />
     <Sandra />
     <Wietske />
     <Storm />
    </div>
  );
}

export default App;
